import React from "react";

function HomePage(){
    //Style
    const TopDeco1 = {
        width: '200px',
        height: '75px',
        'background-color': 'white',
        position: 'absolute'
    }
    return(
        <div class={"BackGroundFormat"}>
            <div class={"shadow-lg rounded Format"}>
                <div style={TopDeco1}></div>
                
            </div>
        </div>
    );
}
export default HomePage;
